import React from "react";

class Button extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render(formText) {
        return (
            <div>
                <button form = "formText">{this.props.text}</button>
            </div>
        );
    }
}

Button.defaultProps = {
    text: "Войти"
};

export default Button;
